schemas.content:
type Query {
  getBlogrolls: [Blogroll]
  getBlogrollID(id: Int): Blogroll
}

type Mutation {
  createBlogroll(createBlogrollInput: BlogrollInput): Blogroll
  updateBlogroll(id: Int, updateBlogrollInput: BlogrollInput): Blogroll
  deleteBlogroll(id: Int): Blogroll
}

type Subscription {
  blogrollCreated: Blogroll
  blogrollUpdated: Blogroll
  blogrollDeleted: Blogroll
}

type Blogroll {
  id: Int
  name: String
  url: String
}

input BlogrollInput {
  name: String
  url: String
}
